        {
            name: "Elon Musk",
            url: "https://specials-images.forbesimg.com/imageserve/5de82785e961e100078f2c1b/960x0.jpg",

        },
    ]);

    return (
        <div className="card">
            {people.map(person => (
                <h1>{person.name}</h1>
            ))}
        </div>
    )
}

